import React, { Component } from 'react';

class Social extends Component {
    render() {
        return (
            <div className="condiv">
                <h1 className="subtopic">About Me</h1>
                <h4>Hey there,</h4>
                <h1>I'm Will Hofkamp</h1>
                <h3>Full Stack Web <u>Developer</u> | UI/UX <u>Designer</u></h3>
                <br></br>
                <a href="https://willhofkamp.github.io/folder/WilliamHofkampResume.pdf" style="color:black">To get all this summarized, check out my resume</a>
                <br></br>
                <p>I started my journey in the world of computers from an young age.</p>
                
                
            </div>
            )
        }
    }
    
export default Social
